    true,nt"url": null,nt"notes": "<ol start="2014">n<li>Centers for Disease
    Control and Prevention (CDC). Best Practices for Comprehensive Tobacco Control Programs.
    Funding. CDC's Best Practices for Comprehensive Tobacco Control Programs is an evidence-based
    guide to help states plan and establish effective tobacco control programs to prevent
    and reduce tobacco use.  These data update Best Practices for Comprehensive Tobacco
    Control Programsu00e2u0080u00942007.  Data are reported at total and per capita
    funding levels. Data include recommended and minimum total funding levels for state
    programs, in addition to funding breakdowns by intervention areas such as: State
    and Community Interventions, Mass-Reach Health Communication Interventions, Cessation
    Interventions, Surveillance and Evaluation, and Infrastructure, Administration,
    and Management.</li>n</ol>n",nt"license_title": "Other License Specified",nt"extras":
